import { NavLink } from "react-router";
import '../../menu/activ.css';
// import '../scroll.css';
import Headroom from 'react-headroom';

// import Sticky from 'react-stickynode';

const setActive = ({isActive}) => isActive ? 'active-link' : 'notactive' ;

const Menupc = () => {

