        <div className={`${menumodule.dropbtn} ${menumodule.glavA}`}>УСЛУГИ <img src={down} alt='down' className={menumodule.down}></img></div>
        <div className={menumodule.dropdowncontent}>
          <a href="#">Link 1</a>
          <a href="#">Link 2</a>
          <a className={menumodule.a}>Link 3</a>
        </div>
      </div>
